description:
Impressionism: Biographical and Critical Study
Skira | 1955 | ISBN: N/A | English | 128 pages | PDF | 14.7 MB

This study of Impressionism inaugurates a series of such studies, devoted to the leading movements of modern painting, which in due course will appear alongside the monographs on individual painters published under the general heading of &quot;The Taste of Our Time.&quot;
